We strive for complete documentation. Every exported symbol ideally should have a documentation line. If possible, use a single line for the JS Doc. Example: /** foo does bar. */
export function foo() { // ...
} It is important that documentation is easily human readable, but there is also a need to provide additional styling information to ensure generated documentation is more rich text. Therefore JSDoc should generally follow markdown markup to enrich the text. While markdown supports HTML tags, it is forbidden in JSDoc blocks. Code string literals should be braced with the back-tick (`) instead of quotes. For example: /** Import something from the `deno` module. */ Do not document function arguments unless they are non-obvious of their intent (though if they are non-obvious intent, the API should be considered anyways). Therefore @param should generally not be used. If @param is used, it should not include the type as TypeScript is already strongly typed. /** * Function with non obvious param. * @param foo Description of non obvious parameter. */ Vertical spacing should be minimized whenever possible. Therefore single line comments should be written as: /** This is a good single line JSDoc. */ And not /** * This is a bad single line JSDoc. */ Code examples should not utilise the triple-back tick (```) notation or tags. They should just be marked by indentation, which requires a break before the block and 6 additional spaces for each line of the example. This is 4 more than the first column of the comment. For example: /** A straight forward comment and an example: * * import { foo } from "deno"; * foo("bar"); */ Code examples should not contain additional comments. It is already inside a comment. If it needs further comments it is not a good example.

